const Android = {
  // 安卓分享
  nativeShare(options) {
    window.androidJS.toShareView(JSON.stringify(options))
  },
  // Web端调用原生
  nativeLeaveConfirm() {},
  // 上传图片
  nativeUpload() {},
  // 文章详情举报
  nativeComplain() {}
}
export default Android
